import React, { Component } from "react";
import axios from "axios";

class CarDetails extends Component {
  constructor(props) {
    super(props);
    this.state = {
      carDetails: null,
    };
  }

  componentDidMount() {
    const carId = this.props.match.params.carId;
    axios
      .get(`YOUR_BACKEND_API_ENDPOINT/cars/${carId}`)
      .then((response) => {
        this.setState({ carDetails: response.data });
      })
      .catch((error) => {
        console.error("Error fetching car details: ", error);
      });
  }

  render() {
    const { carDetails } = this.state;
    console.log(carDetails);

    return (
      <div>
        <h1>Car Details Page</h1>
        {carDetails ? (
          <div>
            <p>Car ID: {carDetails._id}</p>
            <p>Name: {carDetails.name}</p>
            <p>Price: â‚¬{carDetails.price}</p>
            {/* Display other car details as needed */}
          </div>
        ) : (
          <p>Loading...</p>
        )}
      </div>
    );
  }
}

export default CarDetails;
